import React from 'react'

function Content(){
    const date= new Date
    const hours = date.getHours()

    const Style={
        fontSize: 40
    }

    let timeofday
    if (hours <12){
        timeofday='Morning'
        Style.color='blue'
    }
    else if (hours<17){
        timeofday='Afternoon'
        Style.color='red'
    }
    else{
        timeofday="Night"
        Style.color='green'
    }
    return(
    <div>
        <h1 style={Style}>Good {timeofday}</h1>
    </div>
    )
}

export default Content
